INSERT INTO creature_text (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`) VALUES(47293, 0, 0, "This special plague we're spreading will keep Godfrey's forces from leaving the keep, but will still allow us to move our troops in to take it for the Forsaken!", 12, 0, 100) ON DUPLICATE KEY UPDATE `entry` = VALUES(`entry`), `groupid` = VALUES(`groupid`), `id` = VALUES(`id`), `text` = VALUES(`text`), `type` = VALUES(`type`), `language` = VALUES(`language`), `probability` = VALUES(`probability`);
INSERT INTO creature_text (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`) VALUES(47293, 0, 1, "You're more skilled in combat than I thought.", 12, 0, 100) ON DUPLICATE KEY UPDATE `entry` = VALUES(`entry`), `groupid` = VALUES(`groupid`), `id` = VALUES(`id`), `text` = VALUES(`text`), `type` = VALUES(`type`), `language` = VALUES(`language`), `probability` = VALUES(`probability`);
INSERT INTO creature_text (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`) VALUES(47293, 0, 2, "Very well then. Let's get the courtyard door open so we can continue our mission!", 12, 0, 100) ON DUPLICATE KEY UPDATE `entry` = VALUES(`entry`), `groupid` = VALUES(`groupid`), `id` = VALUES(`id`), `text` = VALUES(`text`), `type` = VALUES(`type`), `language` = VALUES(`language`), `probability` = VALUES(`probability`);
