INSERT INTO creature_text (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`) VALUES(47293, 0, 5, "Excellent. Now, to plague this area and move on to-", 12, 0, 100) ON DUPLICATE KEY UPDATE `entry` = VALUES(`entry`), `groupid` = VALUES(`groupid`), `id` = VALUES(`id`), `text` = VALUES(`text`), `type` = VALUES(`type`), `language` = VALUES(`language`), `probability` = VALUES(`probability`);
INSERT INTO creature_text (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`) VALUES(47293, 0, 6, "Cromush! What're you doing here? This is a covert operation!", 12, 0, 100) ON DUPLICATE KEY UPDATE `entry` = VALUES(`entry`), `groupid` = VALUES(`groupid`), `id` = VALUES(`id`), `text` = VALUES(`text`), `type` = VALUES(`type`), `language` = VALUES(`language`), `probability` = VALUES(`probability`);
